#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>
#include <string.h>

bool are_distinct(char *s, int i, int j) {
  char *p1 = s;
  int extended_ascii_array[255] = {0};
  // read string, from pos i to j
  for (int b = i; b < j; b++) {
    extended_ascii_array[(int)*(p1 + b)]++;
    if (extended_ascii_array[(int)*(p1 + b)] > 1) {
      return false;
    }
  }
  return true;
}

int lengthOfLongestSubstring(char *s){
  if (*s == '\0') {
    return 0;
  }
  int longest = 0, len = 0;
  char *p1 = s;
  // calculate string length
  while (*p1 != '\0') {
    len++;
    p1++;
  }

  for (int i = 0; i <= len; i++) {
    for (int j = i; j <= len; j++) {
      if (are_distinct(s, i, j) == true) {
        longest = longest < (j - i) ? (j - i) : longest;
      }
    }
  }

  return longest;
}

